// components/Main/FeatureButtons.jsx
import React from 'react';

export default function FeatureButtons() {
  return (
    <div className="feature-buttons">
      <button>포트폴리오 관리</button>
      <button>프로필 설정</button>
      <button>환경 설정</button>
      <button>커뮤니티</button>
      <button>첨삭받기</button>
    </div>
  );
}
